import React from "react";
import Header from "./components/layout/Header";
import Meals from "./components/Meals/Meals";
import backImage from "./assets/back.jpg"

function App() {
  return (
    <React.Fragment>
      <Header />
      <main>
        <Meals/>
      </main>
      <div > 
        <img src={backImage} alt="a background image of cooking"/>
      </div>
    </React.Fragment>
  );
}

export default App;
